import './App.css';
import Form from './components/Form';
import { useQuery } from '@tanstack/react-query';

function App() {
  const {data} = useQuery(['todos'],async()=>{
    await (await fetch('https://ocalhost:8000/todo')).json()
  })
  console.log('data:');
  return (
    <div className="App">
      <Form/>
    </div>
  );
}

export default App;
